import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './Login';
import AdminDashboard from './AdminDashboard';  // Import Admin Dashboard
import PlayerDashboard from './PlayerDashboard'; // Import Player Dashboard
import Register from './Register'; // Import Register component
import './App.css';
import PlayerManagement from './Player/PlayerManagement';
import ScheduleManagement from './Player/ScheduleManagement';
import TeamManagement from './Player/TeamManagement';
import ReportsManagement from './Player/Reports';
import PlayerStats from './Administrator/PlayerStats';
import ScheduleView from './Administrator/ScheduleView';
import FitnessTracker from './Administrator/FitnessTracker';

const App = () => {
    return (
        <div className="App">
            <Router>
                <Routes>
                    <Route path="/login" element={<Login />} />
                    <Route path="/register" element={<Register />} />
                    <Route path="/admindashboard" element={<AdminDashboard />} />
                    <Route path="/playerdashboard" element={<PlayerDashboard />} />
                    <Route path="/playermanagement" element={<PlayerManagement />} />
                    <Route path="/schedulemanagement" element={<ScheduleManagement />} />
                    <Route path="/teammanagement" element={<TeamManagement />} />
                    <Route path="/reportsmanagement" element={<ReportsManagement />} />
                    <Route path="/playerstats" element={<PlayerStats />} />
                    <Route path="/scheduleview" element={<ScheduleView />} />
                    <Route path="/fitnesstracker" element={<FitnessTracker />} />
                </Routes>
            </Router>
        </div>
    );
};

export default App;
